DROP TABLE IF EXISTS `award_winner`;
DROP TABLE IF EXISTS `admin_account`;
DROP TABLE IF EXISTS `user_account`;
DROP TABLE IF EXISTS `award_type`;
DROP TABLE IF EXISTS `test_users`;

CREATE TABLE `admin_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(255) NOT NULL,
  `last_name` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL UNIQUE,
  `pword` varchar(255) NOT NULL,
  `master` tinyint(1) DEFAULT 0,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 AUTO_INCREMENT = 504;


CREATE TABLE `user_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fname` varchar(255) NOT NULL,
  `lname` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL UNIQUE,
  `pword` varchar(255) NOT NULL,
  `signature` varchar(64000) NOT NULL,
  `timestamp` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE `award_type` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(255) NOT NULL UNIQUE,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE `award_winner` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rid` int(11),
  `gid` int(11),
  `aid` int(11) NOT NULL,
  `date` date NOT NULL,
  `time` time NOT NULL,
  `recipient` varchar(255),
  `giver` varchar(255),
  PRIMARY KEY (`id`),
  FOREIGN KEY (`rid`) REFERENCES `user_account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  FOREIGN KEY (`gid`) REFERENCES `user_account` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  FOREIGN KEY (`aid`) REFERENCES `award_type` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

